window.bookSummaryJSON = "<p>When Montana first started playing in iNcarn8, his new game life, he just wanted to be one of the good guys for a change. But despite his impressive stats and incredible heroics, even his followers are just plain scared of him. Trouble keeps pouring down Montana, even in the remote, supposedly safe holding he's building into his dukedom.&nbsp;</p> <p>All that will have to change if Coggeshall is going to survive. Walls go up and homes get built, but Montana can't shake the feeling that none of it will be enough to keep out the problems of the Empire. Or the world of Vuldranni.</p>"; 
